import React from 'react'

export default function SearchRecipe(props) {
  const OnValueChange = e => {
    props.searchWord(e.target.value)
  }
  return (
    <section>
      <form>
        <label>
          <input 
            type='text'
            name='text'
            placeholder='search...'
            onChange={OnValueChange}
            />
        </label>
      </form>
    </section>
  )
}
